import React from 'react';

export const Jumbtron = () => (
    <div className="jumbotron jumbotron-fluid bg-info">
      <div className="container text-sm-center pt-5 text-white">
        <h1 className="display-2">3D Asset Inventory</h1>
        <p className="lead">3D Models for all your XR application needs</p>
      </div>
    </div>
);
